    <style>
      
      #back-btn {
        position: absolute;
        top: 0;
        left: 0;
        width: 100px;
  		height: 40px;
  		font-size: 16px;
      }
      
      body {
        background-color: lightgray;
      }
     
      #container {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        width: 100vw;
      }
     
      #table {
        background-color: white;
        border-collapse: collapse;
        text-align: center;
        margin: auto;
        width: 80%;
      }
     
      #table tr:first-child {
        background-color: lightgray;
      }
     
    #table tr:nth-child(2) {
  background-color: lightgray;
  color: white;
  height: 500px;
}

     
      #table tr:last-child {
        background-color: lightgray;
        color: white;
      }
     
      #table td {
        padding: 10px;
      }
      table {
  table-layout: fixed;
}
      .images img {
  opacity: 0;
  transition: opacity 1s;
}

.images img:nth-child(1) {
  animation: showImage1 1s forwards;
}

.images img:nth-child(2) {
  animation: showImage2 3s forwards;
}

.images img:nth-child(3) {
  animation: showImage3 5s forwards;
}
      .images img:nth-child(4) {
  animation: showImage4 7s forwards;
}
      .images img:nth-child(5) {
  animation: showImage5 9s forwards;
}
      .images img:nth-child(6) {
  animation: showImage6 11s forwards;
}      
      .images img:nth-child(7) {
  animation: showImage7 13s forwards;
}
      .images img:nth-child(8) {
  animation: showImage8 13s forwards;
}
@keyframes showImage1 {
  to {
    opacity: 1;
  }
}

@keyframes showImage2 {
  to {
    opacity: 1;

}

@keyframes showImage3 {
